import React, { useContext } from "react";
import UserService from "./../00-Context/UserService";
import axios from "axios";
import Table from "./Table/Table";

const Cart = () => {
  const userService = useContext(UserService);

  var products = [];
  var tableRows = [];

  let urlBuilder =
    "https://itpro2017.herokuapp.com/api/users/" +
    userService.username +
    "/cart-products";
  axios
    .get(urlBuilder)
    .then(response => {
      products = response.data;
      console.log(products);
      tableRows = tableRows = products.map(item => {
        console.log(item);
        return <TableRow id={item.id} image={item.image} title={item.title} />;
      });
    })
    .catch(error => {
      console.log(error);
    });

  console.log(products);

  return <Table />;
};

export default Cart;
